description:
This week's episode is all about exploration: We navigate the drowned city in new indie release Submerged, out now from a team of former BioShock developers working as Uppercut Games.

Jonny Robot heads to the stars with Wargaming as they chat about upcoming non-military 4X strategy game Master of Orion (a reboot of the 1993 release).

And we wander lonely through The Chinese Room's latest, Everybody's Gone To The Rapture, with the game's writer, Dan Pinchbeck.

...plus, of course, we have all the latest gaming news as well - this is Player Attack!
